	add("representamen", "{\"term\":\"representamen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027repraesentamen\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A representation, a thing serving to represent something (as to an interpreting mind). It is a representation in the sense of \u0027something which represents\u0027, as opposed to its \u0027operation or relation\u0027 of representing, and also as opposed to a \u0027process or activity\u0027 of representing, which produces it. (The produced representamen can itself seem or be a process or activity, for example a song or a theatrical performance, or a rock\u0027s tumbling in an informative way, or a logical argument\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"circa\u0027 1897\u0027\u0027: w:Charles Sanders Charles Sanders Peirce [aut.] and Justus Buchler [ed.], \u0027Philosophical Writings of Peirce\u0027, chapter 7: “Logic as Semiotic: The Theory of Signs”, § 1: “What is a Sign? Three Divisions of Logic”, page 99 (from a \u0027circa\u0027 1897 manuscript (\u0027CP\u0027 2.227–9), first published in the 1940 selection \u0027The Philosophy of Peirce: Selected Writings\u0027, and later reprinted \u0027sic\u0027 in 1955 by Dover Publications, Inc., New York; ISBN 0486202178, 9780486202174\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sign, or \u0027\u0027\u0027representamen\u0027\u0027\u0027, is something which stands to somebody for something in some respect or capacity\", \"priority\":3}]}, \"synonyms\":{}}");

