	add("reprint", "{\"term\":\"reprint\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|print|lang\u003den}} {{a|verb}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A book, pamphlet or other printed matter that has been published once before but is now being released again\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027reprint\u0027\u0027 is much less expensive than a first edition\", \"priority\":2}]}, \"synonyms\":{}}");

	add("reprisal", "{\"term\":\"reprisal\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027reprisaille\u0027 from Old french (842-ca. 1400) \u0027reprisaille\u0027 (French {{m|fr|représaille}}), from Old italian \u0027ripresaglia\u0027 (Italian {{m|it|rappresaglia}}), from \u0027ripreso\u0027 past participle of \u0027riprendere\u0027 (to take back) from Latin \u0027reprendere\u0027 earlier \u0027reprehendere\u0027 (see reprehend).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of retaliation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something taken from an enemy in retaliation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of taking something from an enemy by way of retaliation or indemnity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"debatable ground, on which incursions and \u0027\u0027reprisals\u0027\u0027 continued to take place\", \"priority\":5}]}, \"synonyms\":{}}");

	add("reprise", "{\"term\":\"reprise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027reprise\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A recurrence or resumption of an action\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A repetition of a phrase, or a return to an earlier theme\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A renewal of a failed attack, after going back into the on guard position\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A taking by way of retaliation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Deductions and duties paid yearly out of a manor and lands, as rent charge, pensions, annuities, etc.; also spelled\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A ship recaptured from an enemy or from a pirate\", \"priority\":6}]}, \"synonyms\":{}}");

	add("reproach", "{\"term\":\"reproach\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027reprochier\u0027 (Modern \u0027reprocher\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mild rebuke, or an implied criticism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Disgrace or shame\", \"priority\":2}]}, \"synonyms\":{}}");

