	add("reprogenetics", "{\"term\":\"reprogenetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of genetics in reproduction, especially in order to choose traits in an offspring or to minimize the risk of genetic disease\", \"priority\":1}]}, \"synonyms\":{}}");

